    <section className="">
      <Image />
      <Title />
      <Author />
    </section>
  );
}

const Image = () => { return (
  <img src="https://images-eu.ssl-images-amazon.com/images/I/61Vj89VXrxL._AC_SX184_.jpg" />
);}

